import React from "react";

import { Routes, Route, NavLink, BrowserRouter } from "react-router-dom";
import { PageCliente } from "../pages/PageCliente";

export const RouterPrincipal = () => {
  return (
    <BrowserRouter>
      <Routes>
         <Route path="/Clientes" element={<PageCliente/>}/>
      </Routes>
    </BrowserRouter>
  );
};
